tables.table_schema:
CREATE TABLE voter_registration (
    voter_id INT PRIMARY KEY,
    full_name VARCHAR(100),
    address VARCHAR(255),
    date_of_birth DATE
);

CREATE TABLE voter_history (
    voter_id UUID REFERENCES voters(voter_id),
    registration_date DATE NOT NULL,
    last_updated TIMESTAMP NOT NULL
);

CREATE TABLE voter_district (
    district_id UUID PRIMARY KEY,
    district_name VARCHAR(50) NOT NULL,
    total_voters INT NOT NULL
);

CREATE TABLE voter_contact (
    contact_id SERIAL PRIMARY KEY,
    voter_id INT REFERENCES voters(voter_id),
    email VARCHAR(50),
    phone_number VARCHAR(15)
);

CREATE TABLE voter_history (
    history_id SERIAL PRIMARY KEY,
    voter_id INT REFERENCES voters(voter_id),
    voting_status VARCHAR(10) NOT NULL,
    last_voted_date TIMESTAMPTZ
);

CREATE TABLE voter_district (
    district_id SERIAL PRIMARY KEY,
    district_name VARCHAR(50) NOT NULL,
    registered_voters INT NOT NULL,
    last_updated TIMESTAMPTZ
);
